import React, { useEffect,useState } from 'react';
import axios from 'axios';

function App() {

  const [todo,SetTodo] = useState(["Hey","Alişan","Ne Haber"]);

  useEffect(() => {

  },[])

  const getData = () => {
    try {
      const data = axios.get("http://localhost:8080/todos/all");
      console.log(data);
    } catch (error) {
      console.log(error);
    }
  }

  getData();

  return (
    <div>
      {
        todo.map(item => {
          return(
            <li>{item}</li>
          )
        })
      }
    </div>
  )
}

export default App
